import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
const Iterms = (props) => {
  return (
    <div>
      <Container>
        <Row>
          <Col sm={2} md={2}>
            <Card style={{ width: "12rem", border: `none` }}>
              <Card.Img variant="top" />
              <Card.Body>
                <Card.Title>
                  {" "}
                  <h2>{props.details.name}</h2>
                </Card.Title>
                <Card.Text>
                  <h2>{props.details.price}</h2>
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Iterms;
